The events of Ocarina of Time are set in the fictional kingdom of Hyrule, the setting of most Zelda games. Hyrule Field serves as the central hub connected to several outlying areas with diverse topography. Most of these areas are populated by the races of Hyrule: Hylians, Kokiri, Gorons, Zoras, Sheikahs and Gerudo.[32]
The game opens as the fairy Navi awakens Link from a nightmare, in which Link witnesses a stormy night where a man in black armor on horseback chases after a girl on a white horse. Navi brings Link to the guardian of Link's village, the Great Deku Tree, who is cursed and near death. Link breaks the curse, but cannot stop the tree from withering. The Deku Tree tells Link a &quot;wicked man of the desert&quot; has cursed him and seeks to conquer the land of Hyrule and that Link must stop him. Before dying, the Great Deku Tree gives Link the spiritual stone of the forest, the Kokiri's Emerald, and sends him to Hyrule Castle to speak with the &quot;princess of destiny.&quot;[33] As Link is leaving, his close friend Saria bids him good luck and gives him the Fairy Ocarina, a precursor to the Ocarina of Time. &lt;a href=&quot;
